		function setupQuestion() {
		
			//-----הגרלת מספר השאלה האקראית מהמאגר 
			globalThis.rand = Math.floor((Math.random() * boardStones.length));
			console.log("rand is equal to " + rand);
			//----------ערבוב המסיחים----------
			//-----יצירת מערכים שיקלטו את השאלות והתשובות
			globalThis.boardAnswers = [];
			globalThis.handAnswers = [];
		
			//-----מערכים זמניים לקליטת שאלה לערבול
			//מערך קטן יותר שמכיל רק את פרטי מסיחים/תשובות של שאלה אחת
			globalThis.tempQuestion = boardStones[rand].slice();
			globalThis.tempSolution = handStones[rand].slice();
		
			//-----ערבול המסיחים מתוך המערך הזמני
			for (i = 0; i < (boardStones[rand].length); i++) {
				//הגרלת המסיח אותו אנחנו מוציאים כרגע
				var randAns = Math.floor((Math.random() * tempQuestion.length));
				var randSol = Math.floor((Math.random() * tempSolution.length));
				//הוספת המסיח המוגרל למערך הסופי
				boardAnswers[i] = tempQuestion[randAns];
				handAnswers[i] = tempSolution[randSol];
		
				//הסרת המסיח מתוך המערך הזמני
				tempQuestion.splice(randAns, 1);
				tempSolution.splice(randSol, 1);
			}
		}
		
