		// every second count down and show on text field
		function timerFunc() {
		
			if (countdown > 9) {
				output.text = "00:" + countdown
			} else if (countdown > 0) {
				output.text = "00:0" + countdown
			} else {
				//כאן יהיה המעבר לסוף הזמן
				output.text = "00:00"
				clearInterval(intervalvar);
				timeOver()
			}
			countdown--
			accTim++
		}
		
