		function keyVoon(event) {
			if (event.keyCode == 38) {
				//up		
				stage.getChildByName("Player").gotoAndStop(1);
				//stage.getChildByName("Player").gotoAndStop(0);
				//stage.getChildByName("Player").gotoAndStop(1);
				moveUP();
			}
			if (event.keyCode == 37) {
				//left
				moveL();
			}
			if (event.keyCode == 39) {
				//right
				moveR();
			}
		}
		
		function keySpace(event) {
			if (event.keyCode == 32) {
				//space
				console.log("keySpace 1");
				handAnswers.push(handAnswers[0]);
				stage.removeChild(stage.getChildByName("onlySrn"));
				stage.removeChild(stage.getChildByName("onlyBtn"));
				stage.removeChild(stage.getChildByName("onlyBtnTxt"));
				stage.removeChild(stage.getChildByName("stnTxt" + textCounter));
				output.text = "";
				//clearInterval(intervalvar);
				//createTimer();
				// interval to play function every 1000 milisecondsה
				globalThis.intervalvar = setInterval(timerFunc, 1000);
				// starts at 59
				countdown = 59;
				window.removeEventListener("keydown", keySpace);
				nextStone(1);
			}
		}
		
